  constructor(props) {
    super(props)
    this.iconSize = 20;
  }

  render() {
    return (
      <div className="app">
        <main>
          <div className="container main-container">
            <div className="row main-row">

              <div className="col-2 mr-2 menu-container">
                <div className="menu">
                  <div className="menu-icons-container">
                    <HouseFill className="menu-icons" size={this.iconSize} />
                  </div>
                  <div className="menu-icons-container">
                    <CalendarDateFill className="menu-icons" size={this.iconSize} />
